★ディアドラのストッキング！<br>
<br>
●履き口のラインとブランドロゴだけのシンプルデザイン。<br>
●何足あっても困らないストッキングは、タウンユースとしてもお使いいただけます。<br>
●程よく足にフィットし、適度な締め付け！<br>
●纏め買いやチームでお揃い購入もオススメ！<br>
<br>
■素材 ナイロン100％<br>
■企画製造販売元<br>
新社名 株式会社ディーエムアール<br>
旧社名 株式会社ディアドラ・ジャパン<br>
<br>
※画像のカラーは、撮影時の照明等の具合により実物と異なる可能性がございます。<br>
