★PUMAのキッズ用ゲームストッキングがお得な3足セット！<br>
<br>
●サッカー、フットサルなどのスポーツで使えるキッズ用ソックスです。<br>
●部活や試合などに使い分けても便利でチーム用にも揃えやすい！<br>
●豊富なカラーとサイズに加え同色3足セットなので、お洗濯にも困りません！<br>
●プーマロゴが入った飽きのこないベーシックタイプです。<br>
<br>
■素材：ポリエステル・綿・その他<br>
■企画製造販売元　プーマジャパン株式会社<br>
