★ナイキのゲームソックス！<br>
<br>
●丈夫な素材をブレンドし、補強した構造により、サッカーを始めたばかりのプレーヤーに理想的なソックスです！<br>
●ぴったりフィットするリブ加工を施した履き口！<br>
●補強されたかかととつま先が耐久性を強化！<br>
<br>
■素材 ポリエステル89％、綿9％、ポリウレタン2％<br>
